import React from 'react';
import Header from './components/Header';
import ItineraryList from './components/ItineraryList';
import AddItineraryForm from './components/AddItineraryForm';

function App() {
  return (
    <div className="App">
      <Header />
      <AddItineraryForm />
      <ItineraryList />
    </div>
  );
}

export default App;
